import './Header.css'
import logo from "../assets/image/header/logoCinemaGreen.png";
import ButtonHeader from './'

export function Header(){
    return(
        <section className="header">
            <img src={logo} alt="Логотип кинотеатра" className="logoCinema"/>

        </section>
    )
}
